  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC NEWS DIGEST ISSUE 89-190, DATED OCTOBER 4, 1989 -  ADMINISTRATIVE PROCEEDINGS DISCLOSE: 'PROCEEDINGS INSTITUTED  AGAINST GARY W. CHAMBERS'; PUBLIC ADMINISTRATIVE PROCEEDINGS  HAVE BEEN INSTITUTED AGAINST GARY W. CHAMBERS, FORMER  COMPLIANCE DIRECTOR OF A FIRM.  THE ORDER ALLEGES THAT CHAMBERS FAILED TO REASONABLY SUPERVISE,  WITHIN THE MEANING OF SECTION 15(B)(4)(E) OF THE SECURITIES  EXCHANGE ACT OF 1934, TWO BROKERS WITH A VIEW TO PREVENTING  THEIR EXCESSIVE AND UNSUITABLE TRADING AND VARIOUS  MISREPRESENTATIONS OF MATERIAL FACTS MADE BY THEM IN CONNECTION  WITH THEIR TRADING. THE ACCOUNTS INVOLVED WERE SEVERAL SMALL  CALIFORNIA MUNICIPALITIES AND LOCAL AGENCIES. AMONG OTHER  THINGS, THE ORDER ALLEGES THAT CHAMBERS DID NOT (1) ENSURE THAT  THE BROKERS' TRADING WAS IN CONFORMITY WITH THE CUSTOMERS'  INVESTMENT OBJECTIVES; (2) ENSURE THAT THE BROKERS WERE NOT  CHURNING THEIR ACCOUNTS; AND (3) FOLLOW CERTAIN OF THE  SUPERVISORY AND COMPLIANCE PROCEDURES ADOPTED BY HIS FIRM. A HEARING  WILL BE SCHEDULED TO DETERMIN WHETHER THE ALLEGATIONS ARE TRUE  AND WHETHER ANY REMEDIAL ACTION IS NECESSARY FOR THE PROTECTION  OF INVESTORS. (REL. 34-27298) SEC NEWS DIGEST ISSUE NO. 90-57, DATED MARCH 23, 1990  DICLOSES: THE COMMISSION INSTITUTED PUBLIC ADMINISTRATIVE  PROCEEDINGS UNDER SECTIONS 15(B) AND 19(H) OF THE SECURITIES  EXCHANGE ACT AGAINST GARY W. CHAMBERS (CHAMBERS), WHICH  SUPERSEDES THE COMMISSION'S PREVIOUS ORDER DATED SEPTEMBER 27,  1989. THE ORDER ALLEGES THAT CHAMBERS, THE FORMER SENIOR VICE  PRESIDENT OF COMPLIANCE AND OPERATIONS AT A FIRM, FAILED TO ADEQUATELY SUPERVISE THE SALES  PRACTICES OF INDIVIDUALS WITH A VIEW TO PREVENTING THEIR VIOLATIONS WITHIN THE MEANING  OF SECTION 15(B)(4)(E) OF THE ACT. (FOR A MORE DETAILED  DISCUSSION OF THE BROKERS' VIOLATIONS, SEE RELEASE 34-27299.)    ",
  "Resolution" : "Decision & Order of Offer of Settlement",
  "SanctionDetails" : [ {
    "Sanctions" : "Suspension"
  } ],
  "Sanctions" : "UNDERTAKINGS",
  "Sanction Details" : "THE  COMMISSION DETERMINED TO ACCEPT CHAMBERS' OFFER OF SETTLEMENT IN  WHICH HE NEITHER ADMITS NOR DENIES THE COMMISSION'S FINDINGS AND  AGREES TO BE SUSPENDED FOR SIX MONTHS FROM ASSOCIATING, IN A  6 SUPERVISORY CAPACITY, WITH ANY BROKER-DEALER, INVESTMENT  COMPANY, INVESTMENT ADVISER OR MUNICIPAL SECURITIES DEALER, AND  TO COMPLY WITH CERTAIN UNDERTAKINGS.  (REL. 34-27963).  ",
  "Broker Comment" : "ON NOVEMBER 28, 1990 AN AFFIDAVIT WAS MAILED TO SEC'S LA OFFICE VIA U. S. POSTAL SERVICES ADVISION RESPONDENT WAS NO LONGER ASSOCIATED WITH A BROKER/DEALER IN ANY CAPACITY DURING THE PERIOD OF THE SUSPENSION."
}

